import React from 'react';

function Auth() {
  return (
    <>
      <div class="flex flex-row justify-center items-center space-x-20">
        <div class="flex flex-col w-96">
          <img src="assets/logo.svg" alt="main image" />
          <img src="assets/main_image.svg" alt="main image" />
        </div>
        <Auth />
      </div>
      <div class="flex justify-center items-center mt-9">
        <Paragraph />
      </div>
    </>
  );
}

export default Auth;
